import Homepage4 from "../../components/homecontainer4";
const Homepage = () => {
  return (
    <>
      <Banner />
      {/* <Homepage1 /> */}
      <Homepage2 />
      <Homepage3 />
      <Homepage4 />
    </>
  );
};
export default Homepage;
